import React from "react";
import Section4Image from "./Images/4.jpg";

const SearchPage = () => (
  <div
    style={{  
      backgroundImage: `url(${Section4Image})`,
      backgroundPosition: 'center',
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat',
      height: '100%'
    }}
  >
  </div>
);

export default SearchPage;
